import React from 'react';
import { Header } from '../Main/BasketPage/components/BasketHeader';

export default {

  title: 'Header',
  component: Header,
  argTypes: {
    tasks: { controle: 'array' },
    names: { controle: 'array' },
  },
};

function Template(args) {
  // eslint-disable-next-line react/jsx-props-no-spreading
  return <Header {...args} />;
}

export const Basket = Template.bind({});
Basket.args = {
  tasks: [1, 2, 3],
  names: ['name', 'count', 'price', 'total price'],
};



Basket.parameters = { storySource: { source: "Template.bind({})" }, ...Basket.parameters };
